import React from "react";
import { Container } from "react-bootstrap";

const Usuarios = () => {
    return(
        <Container className='mt-4'>
            <h3>Lista de Usuarios</h3>
            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Nome</th>
                        <th>Email</th>
                        <th>Ações</th>
                    </tr>
                </thead>
            </Table>

        </Container>
    )
}	


export default Usuarios;
